import React, { useEffect, useState } from "react";

import { useAuth } from "../provider/authProvider";
import { useNavigate } from "react-router-dom";
import Rosary from "../models/rosary";

const Home = () => {
  //   const navigate = useNavigate();
  const { token } = useAuth();
  const [ros, setRos] = useState({});
  useEffect(() => {
    const getRosary = async () => {
      const today2 = await Rosary.getByDate("2023/05/30");
      setRos((r) => ({ ...r, ...today2.data[0] }));
      // console.log(today2.data[0]);

      for (let data of ros.data) {
        console.log(data.i_believe);
      }
    };
    getRosary();
  }, []);
  // console.log(ros);
  const parseData = () => {
    for (let data of ros) {
      return (
        <>
          <p>{data}</p>
          <br />
        </>
      );
    }
  };

  return (
    <div>
      <h1>Home page</h1>
    </div>
  );
};

export default Home;
